import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for a product card using a unique product title text (e.g., "Apple iPhone 15 Pro Max")
    const productTitle = "Apple iPhone 15 Pro Max";
    const productCard = await page.waitForSelector(`.product-card:has-text("${productTitle}")`, { timeout: 5000 });

    // Scroll into view to ensure visibility
    await productCard.scrollIntoViewIfNeeded();

    // Click the product card to open the Product Detail Modal
    await productCard.click();

    // Wait for the modal to appear using its id and a unique text in the modal (e.g., product title)
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector(`.product-detail-title:has-text("${productTitle}")`, { timeout: 5000 });

    // Take screenshot of the opened modal
    const step2 = path.join(screenshotsDir, 'step_2_modal_opened.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract some data from the modal to verify it's open
    const modalTitle = await page.textContent('.product-detail-title');
    const modalPrice = await page.textContent('.product-detail-price');

    return {
      success: true,
      action: "Opened Product Detail Modal for Apple iPhone 15 Pro Max",
      extractedData: {
        modalTitle: modalTitle ? modalTitle.trim() : null,
        modalPrice: modalPrice ? modalPrice.trim() : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
